import React from "react";
import {add, sub, div, mul} from "./Calc";

function App(){

    return(

   <>
     <h1> Sum of two Num {add(a, b)} </h1>
     <h1> Sum of two Num {sub(40, 4)} </h1>
     <h1> Sum of two Num {div(40, 4)} </h1>
     <h1> Sum of two Num {mul(40, 4)} </h1>
  
    </>
    );
    
}


export default App;
